//import Link from 'next/link'
import Head from 'next/head'
import FaviIcon from '../../atoms/atFavIcon'
import HeaderMinhaOi from '../../organisms/minha-oi/headerMinhaOi.js'
import FooterMinhaOi from '../../organisms/minha-oi/footerMinhaOi.js'
import ContentAtendimento from '../../organisms/minha-oi/contentAtendimento.js'
import Line from '../../atoms/atLine';
import HeaderMenu from "../../moleculas/minha-oi/headerMenu";
import * as Util from '../../../controller/util.js';

const atendimentoOi = function(props){

  console.log('╔════════════════════════════════════════╗');
  console.log('║        codigo   atendimento-oi         ║');
  console.log('╚════════════════════════════════════════╝');

  var cidade = Util.validaProps(props.cidade,"Rio de Janeiro");
  var modo = Util.validaProps(props.modo,"html");


  return(
  <div>
    <Head>
      <title>Atendimento Oi</title>
      <FaviIcon />
      <meta name="description" content="Atendimento Oi" />
      <meta name="robots" content="noindex" />
      <link rel="canonical" href="https://www.oi.com.br/minha-oi/atendimento-oi/"/>
      <link rel="amphtml" href="https://www.oi.com.br/amp/minha-oi/atendimento-oi/"/>
      <script async custom-element="amp-lightbox" src="https://cdn.ampproject.org/v0/amp-lightbox-0.1.js"></script>
      <script async custom-element="amp-iframe" src="https://cdn.ampproject.org/v0/amp-iframe-0.1.js"></script>

    </Head>
    <div className="atendimentoOi">
    {/*<HeaderMinhaOi modo={modo} Cidade={cidade}/>
     <ContentAtendimento modo={modo} Cidade={cidade}/>
    <FooterMinhaOi modo={modo} Cidade={cidade}/> */}
    </div>

    <style jsx>{`
      .atendimentoOi{
        /* width:100%;
        justify-content: center;
        align-items: center;
        display: flex;
        flex-direction: row;
        flex-wrap: wrap; */
      }
    `}</style>
    <style jsx global>{`
        ${Util.fontesCSS1()}
        ${Util.fontesCSS2()}
        ${Util.fontesCSS3()}
        ${Util.fontesCSS4()}
        ${Util.fontesCSS5()}
        body{
          margin: 0px;
          padding: 0px;
          background-color: #ffffff;
          font-family: SimplonBP-Regular, sans-serif;        
        }
    `}</style>
  </div>
)}

export default atendimentoOi
